import axios from "axios";
import Navbar from "../../molecules/navbar/navbar"
import PostCard from "../../molecules/card/card"
import BenchForm from "../../organisms/benchForm/BenchForm";
import Grid from '@material-ui/core/Grid';

const CardPage = (props) => {

    const postCardId = props.match.params.id;

    function randomImg(width, height, key) {
        var source = 'https://source.unsplash.com/random/' + width + 'x' + height + '/?bench,park' + key;
        return source;
    }

    if (postCardId === 'new') {
        return (
            <BenchForm/>
        )
    } else {

    }
    return (
        <Fragment>
            <Navbar />
            <Grid container spacing={3} justify="center"
                alignItems="center">
                <Grid item xs={4}  >
                    <PostCard
                        id={postCardId}
                        image={randomImg(500, 500, postCardId)}
                        deleteButton={true}
                        // title={obj.title}
                        // valueQuietness={obj.quietness}
                        // valueRating={calRating(postCardId)}
                        // amountBenches={obj.amountBenches}
                        // amountFirePlaces={obj.amountFirePlaces}
                        // amountTrashCans={obj.amountTrashCans}
                        // distanceToNextShop={obj.distanceToNextShop}
                        // directions={obj.directions}
                        readOnly={true}
                    />
                </Grid>

            </Grid>
        </Fragment>
    );
};

export default CardPage;
